import { Component } from "@angular/core"
import * as go from "gojs"
import { Requirements } from "./interfaces/requirements"
import { BackendService } from "./services/backend.service";

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.sass']
})
export class AppComponent {
    title = "tree-visualizer";

    public selectedNode: go.Node | null = null;
    model = new go.TreeModel({
        nodeKeyProperty: "id",
        nodeDataArray: [],
    });

    constructor(private backend: BackendService) {
        backend.getRequirements().subscribe(r => this.initModel(r))
    };

    initModel(r: Requirements) {
        this.model.commit(m => m.mergeNodeDataArray(r))
    }

  public setSelectedNode(node: go.Node) {
    this.selectedNode = node;
    console.log(this.selectedNode)
  }

}

import { Component, Input, OnChanges, SimpleChanges } from '@angular/core';
import { Requirement } from 'src/app/interfaces/requirement';

@Component({
    selector: 'app-inspector',
    templateUrl: './inspector.component.html',
    styleUrls: ['./inspector.component.sass']
})
export class InspectorComponent implements OnChanges {
    @Input() public selectedNode: go.Part | null = null;

    read_only = true;
    qualifiers = ['SHALL', 'SHOULD', 'WILL'];

    requirement: string = 'FINCH-TreeVisualizer-Placeholder';
    created_by: string = 'John Doe';
    parent: string = 'FINCH-Team-Placeholder';
    last_edited: Date | null = new Date();
    qualifier: string = 'SHALL';
    collection: string = 'Tree visualizer';
    test_plans: string[] = ['Test plan 1 (placeholder link)'];
    system: string = 'Tree Visualizer';
    rationale: string = 'To do stuff';
    trades: string[] = ['Trade 1 (placeholder link)'];
    last_edited_by: string = 'Jane Doe';
    stakeholders: string[] = ['Systems'];
    mission: string = 'FINCH';
    description: string = 'The tree visualizer shall do things'
    url: URL | null = new URL('https://www.notion.so/FINCH-Power-Batteries-74331bc1129c417c850a0a5ca0deb759')

    ngOnChanges(changes: SimpleChanges) {
        const val = changes['selectedNode'].currentValue;

        if (val === null) {
            this.requirement = '-';
            this.created_by = '-';
            this.parent = '-';
            this.last_edited = null;
            this.qualifier = '-';
            this.collection = '-';
            this.test_plans = ['-'];
            this.system = '-';
            this.rationale = '-';
            this.trades = ['-'];
            this.last_edited_by = '-';
            this.stakeholders = ['-'];
            this.mission = '-';
            this.description = '-';
            this.url = null;
        }
        else {
            const data: Requirement = val.data;
            const parent: go.Node | null = val.findTreeParentNode();

            this.requirement = data.title;
            this.created_by = data['created-by'];
            this.parent = parent ? parent.data.title : '';
            this.last_edited = new Date(data['last-edited']);
            this.qualifier = data.qualifier;
            this.collection = data.collection.join(', ');
            this.test_plans = data['test-plans'].length > 0 ? data['test-plans'] : [''];
            this.system = data.system;
            this.rationale = data.rationale;
            this.trades = data.trades.length > 0 ? data.trades : [''];
            this.last_edited_by = data['last-edited-by'];
            this.stakeholders = data.stakeholder.length > 0 ? data.stakeholder : [''];
            this.mission = data.mission;
            this.description = data.description;
            this.url = data.url ? new URL(data.url) : null;
        }
    }
}

import { AfterViewInit, Component, EventEmitter, Input, OnInit, Output } from "@angular/core"
import * as go from "gojs"

const $ = go.GraphObject.make

@Component({
  selector: 'app-node-directory',
  templateUrl: './node-directory.component.html',
  styleUrls: ['./node-directory.component.sass']
})
export class NodeDirectoryComponent implements OnInit, AfterViewInit {
  public diagram: go.Diagram = new go.Diagram()
  
  public _selectedNode: go.Node | null = null;
  public node_found: go.Node | null = null; 

  @Input()
  public model: go.TreeModel = new go.TreeModel()

  @Input()
  get selectedNode() { return this._selectedNode; }
  set selectedNode(node: go.Node | null) {
    if (node != null) {
      this._selectedNode = node;
      console.log('Node clicked:')
      console.log(this._selectedNode.data.title)

      if (this.node_found != null) {
        // set the previous selected node to false
        this.diagram.model.setDataProperty(this.node_found.data, 'isSelected', false)
        this.diagram.updateAllTargetBindings();
      }
      this.node_found = this.diagram.findNodeForKey(this._selectedNode.data.id)
      console.log('Looking for node')
      if (this.node_found !== null) {
        console.log('Node found:')
        console.log(this.node_found.data)

        console.log(this.node_found.data.isSelected)
        this.diagram.model.setDataProperty(this.node_found.data, 'isSelected', true)
        console.log(this.node_found.data.isSelected)
        this.diagram.updateAllTargetBindings();
      } else {
        // Node not found
        console.log("Node not found");
      }

    } else {
      this._selectedNode = null;
      if (this.node_found != null) {
        // set the previous selected node to false
        this.diagram.model.setDataProperty(this.node_found.data, 'isSelected', false)
        this.diagram.updateAllTargetBindings();
      }
    }
  }

  @Output()
  public nodeClicked = new EventEmitter()

  constructor() {}

  public ngOnInit() {
    console.log(this.selectedNode)
    console.log('ngOnInit')
  }

  public ngAfterViewInit() {

      this.diagram = $(go.Diagram, "app-node-directory",
      {
        allowMove: false,
        allowCopy: false,
        allowDelete: false,
        allowHorizontalScroll: true,
        allowVerticalScroll: true,
        contentAlignment: go.Spot.TopLeft,
        padding: new go.Margin(75, 0, 0, 0),
        layout:
          $(go.TreeLayout,
            {
              alignment: go.TreeLayout.AlignmentStart,
              angle: 0,
              compaction: go.TreeLayout.CompactionNone,
              layerSpacing: 16,
              layerSpacingParentOverlap: 1,
              nodeIndentPastParent: 1.0,
              nodeSpacing: 0,
              setsPortSpot: false,
              setsChildPortSpot: false
            })
      });

    // define the Node template
    this.diagram.nodeTemplate =
      $(go.Node, 
      $("TreeExpanderButton",
        { // customize the button's appearance
          "_treeExpandedFigure": "LineDown",
          "_treeCollapsedFigure": "LineRight",
          "ButtonBorder.fill": "whitesmoke",
          "ButtonBorder.stroke": null,
          "_buttonFillOver": "rgba(0,128,255,0.25)",
          "_buttonStrokeOver": null
        }),
      $(go.Panel, "Horizontal",
        { position: new go.Point(18, 0) },
        new go.Binding("background", "", function(data) {
          return data.isSelected ? "lightblue" : "white";
        }),
        $(go.Picture,
          {
            width: 18, height: 18,
            margin: new go.Margin(0, 4, 0, 0),
            imageStretch: go.GraphObject.Uniform
          },
          // bind the picture source on two properties of the Node
          // to display open folder, closed folder, or document
          new go.Binding("source", "isTreeExpanded", imageConverter).ofObject(),
          new go.Binding("source", "isTreeLeaf", imageConverter).ofObject()),
        $(go.TextBlock,
          { font: '9pt Verdana, sans-serif' },
          new go.Binding("text", "title", s => "" + s))
      )  // end Horizontal Panel
    );  // end Node

  this.diagram.linkTemplate = $(go.Link)

  this.diagram.model = this.model;

  // when selection changes, emit event to update the selected node
  this.diagram.addDiagramListener("ChangedSelection", (e) => {
    const node = this.diagram?.selection.first()
    console.log(this.model.toJson())
    this.nodeClicked.emit(node)
  })

  // takes a property change on either isTreeLeaf or isTreeExpanded and selects the correct image to use
  function imageConverter(prop: any, picture: any) {
    var node = picture.part;
    if (node.isTreeLeaf) {
      return "https://www.iconpacks.net/icons/1/free-document-icon-901-thumb.png";
    } else {
      if (node.isTreeExpanded) {
        return "https://www.clipartmax.com/png/middle/129-1292051_lower-nursery-open-folder-icon-png.png";
      } else {
        return "https://img.icons8.com/color/512/folder-invoices--v1.png";
      }
    }
  }
  window.addEventListener('DOMContentLoaded', this.ngAfterViewInit);
  }

}

import { Component, EventEmitter, Input, OnInit, Output } from "@angular/core"
import * as go from "gojs"

const $ = go.GraphObject.make

@Component({
    selector: "app-org-chart",
    templateUrl: "./org-chart.component.html",
    styleUrls: ["./org-chart.component.sass"],
})
export class OrgChartComponent implements OnInit {
    public diagram: go.Diagram = new go.Diagram()
    public minimap: go.Overview | null = null
    public nodeSize = new go.Size(256, 128)
    public font = "sans-serif"

    public _selectedNode: go.Node | null = null;
    public node_found: go.Node | null = null;

    @Input() 
    public model: go.TreeModel = new go.TreeModel()

    @Input()
    get selectedNode() { return this._selectedNode; }
    set selectedNode(node: go.Node | null) {
        if (node != null) {
        this._selectedNode = node;
        console.log('Node clicked:')
        console.log(this._selectedNode.data)

        if (this.node_found != null) {
            // set the previous selected node to false
            this.diagram.model.setDataProperty(this.node_found.data, 'isSelected', false)
            this.diagram.updateAllTargetBindings();
        }
        this.node_found = this.diagram.findNodeForKey(this._selectedNode.data.id)
        console.log('Looking for node')
        if (this.node_found !== null) {
            console.log('Node found:')
            console.log(this.node_found.data)

            console.log(this.node_found.data.isSelected)
            this.diagram.model.setDataProperty(this.node_found.data, 'isSelected', 'true')
            console.log(this.node_found.data.isSelected)
            this.diagram.updateAllTargetBindings();
        } else {
            // Node not found
            console.log("Node not found");
        }

        } else {
        this._selectedNode = null;
        if (this.node_found != null) {
            // set the previous selected node to false
            this.diagram.model.setDataProperty(this.node_found.data, 'isSelected', false)
            this.diagram.updateAllTargetBindings();
        }
        }
    }

    @Output() 
    public nodeClicked = new EventEmitter()

    public showMap = true

    constructor() {}

    public ngOnInit() {
        console.log(this.selectedNode)
        console.log('ngOnInig')
    }

    public ngAfterViewInit() {
        this.diagram = $(go.Diagram, "app-org-chart", {
            allowCopy: false,
            allowDelete: false,
            layout: $(go.TreeLayout, {
                treeStyle: go.TreeLayout.StyleLastParents,
                arrangement: go.TreeLayout.ArrangementHorizontal,
                // properties for most of the tree:
                angle: 90,
                layerSpacing: 35,
                // properties for the leaf parents:
                alternateAngle: 90,
                alternateLayerSpacing: 35,
                alternateAlignment: go.TreeLayout.AlignmentBus,
                alternateNodeSpacing: 20,
            }),
            "undoManager.isEnabled": true,
        })

        this.diagram.nodeTemplate = $(
            go.Node,
            "Auto",
            {
                desiredSize: this.nodeSize,
                isShadowed: true,
                shadowOffset: new go.Point(2, 2),
                shadowColor: "#DDD",
                shadowBlur: 6,
                mouseDragEnter: (e, node, prev) => {
                    const shape: go.Shape = (node as go.Part).findObject(
                        "SHAPE"
                    ) as go.Shape
                    shape.stroke = "dodgerblue"
                    shape.strokeWidth = 3

                    const shape2: go.Shape = (prev as go.Part).findObject(
                        "SHAPE"
                    ) as go.Shape
                    shape2.stroke = "green"
                    shape2.strokeWidth = 3
                },
                mouseDragLeave: (e, node, next) => {
                    const shape: go.Shape = (node as go.Part).findObject(
                        "SHAPE"
                    ) as go.Shape
                    shape.stroke = "dodgerblue"
                    shape.strokeWidth = 0
                },
                mouseDrop: (e, node) => {
                    const diagram = node.diagram
                    const selnode = diagram?.selection.first() as go.Node // assume just one Node in selection
                    // find any existing link into the selected node
                    const link = selnode.findTreeParentLink()
                    if (link !== null) {
                        // reconnect any existing link
                        link.fromNode = node as go.Node
                    } else {
                        // else create a new link
                        diagram?.toolManager.linkingTool.insertLink(
                            node as go.Node,
                            (node as go.Node).port,
                            selnode,
                            selnode.port
                        )
                    }
                },
            },
            $(go.Shape,
                "Rectangle",
                {
                  name: "SHAPE",
                  strokeWidth: 0,
                },
                new go.Binding("fill", "", function(data) {
                  return data.isSelected ? "lightblue" : "white";
                })
              ),
            $(
                go.Panel,
                "Table",
                {
                    alignment: go.Spot.TopLeft,
                    margin: 16,
                    defaultAlignment: go.Spot.Left,
                },
                $(go.RowColumnDefinition, {
                    column: 0,
                    width: this.nodeSize.width - 50,
                }),
                $(
                    go.TextBlock,
                    {
                        row: 0,
                        column: 0,
                        font: "bold 12pt " + this.font,
                        overflow: go.TextBlock.OverflowEllipsis,
                    },
                    new go.Binding("text", "title")
                ),
                $(
                    go.Shape, // chip
                    "RoundedRectangle",
                    {
                        row: 1,
                        column: 0,
                        width: 70,
                        height: 18,
                        parameter1: 100,
                        strokeWidth: 0,
                    },
                    new go.Binding("fill", "qualifier", (qualifier) => {
                        if (qualifier === "SHALL") {
                            return "#06c769" // green
                        } else if (qualifier === "SHOULD") {
                            return "#2196f3" // blue
                        } else {
                            return "#cccccc" // default grey
                        }
                    })
                ),
                $(
                    go.TextBlock,
                    {
                        row: 1,
                        column: 0,
                        font: "10pt " + this.font,
                        stroke: "white",
                        margin: 6,
                    },
                    new go.Binding("text", "qualifier")
                ),
                $(
                    go.TextBlock,
                    {
                        row: 2,
                        column: 0,
                        font: "10pt " + this.font,
                        stretch: go.GraphObject.Fill,
                        maxLines: 3,
                        overflow: go.TextBlock.OverflowEllipsis,
                    },
                    new go.Binding("text", "description")
                )
            )
        )

        this.diagram.linkTemplate = $(
            go.Link, // the whole link panel
            go.Link.Orthogonal,
            $(go.Shape) // the link shape, default black stroke
        )

        this.minimap = $(go.Overview, "app-minimap", { observed: this.diagram })

        this.diagram.model = this.model

        // when selection changes, emit event to update the selected node
        this.diagram.addDiagramListener("ChangedSelection", (e) => {
            const node = this.diagram?.selection.first()
            console.log(this.model.toJson())
            this.nodeClicked.emit(node)
        })
    }
}

